"use strict";import axios from"axios";import emailValidator from"email-validator";import passValidator from"password-validator";import validUrl from"valid-url";import constants from"/constants";function setAxios(){axios.defaults.baseURL=constants.API_URL,axios.defaults.headers.post["Content-Type"]=constants.CONTENT_TYPE,constants.TOKEN&&(axios.defaults.headers.common.Authorization="Bearer "+constants.TOKEN)}async function getData(a){return setAxios(),(await axios.get(a)).data}async function postData(a,t){return setAxios(),(await axios.post(a,t)).data}async function patchData(a,t){return setAxios(),(await axios.patch(a,t)).data}async function putData(a,t){return setAxios(),(await axios.put(a,t)).data}async function deleteData(a){return setAxios(),(await axios.delete(a)).data}function checkEmail(a){return!!emailValidator.validate(a)||(alert(constants.ALERT_EMAIL),!1)}function checkPass(a){var t=new passValidator;return t.is().min(constants.PASS_MIN).is().max(constants.PASS_MAX).has().uppercase().has().lowercase().has().digits(constants.PASS_INT).has().not().spaces(),!!t.validate(a)||(alert(constants.ALERT_PASS),!1)}function checkUrl(a){return!!validUrl.isUri(a)||(alert(constants.ALERT_URL),!1)}export default{getData:getData,postData:postData,patchData:patchData,putData:putData,deleteData:deleteData,checkEmail:checkEmail,checkPass:checkPass,checkUrl:checkUrl};